import React, { useEffect, useState } from "react";
import Axios from "axios";
import { Avatar, Button, Container, CssBaseline, IconButton, Typography, Menu, MenuItem, Grid, CircularProgress, TextField, Card, CardContent, Paper, ThemeProvider } from '@mui/material';
import { styled } from '@mui/system';
import MoreVertIcon from '@mui/icons-material/MoreVert';
import EditIcon from '@mui/icons-material/Edit';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import EmailIcon from '@mui/icons-material/Email';
import WorkIcon from '@mui/icons-material/Work';
import CakeIcon from '@mui/icons-material/Cake';
import HeightIcon from '@mui/icons-material/Height';
import FitnessCenterIcon from '@mui/icons-material/FitnessCenter';
import FavoriteIcon from '@mui/icons-material/Favorite';
import InfoIcon from '@mui/icons-material/Info';
import { useNavigate } from 'react-router-dom';

import theme from './Theme/theme';
import logo from './Theme/images/baselogo.jpg';

// Styled components using MUI's new styled API
export const AppContainer = styled(Container)(({ theme }) => ({
    zIndex: 9999,
    backgroundColor: '#f5f5f5',
    minHeight: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: theme.spacing(2),
}));

export const Logo = styled('img')(({ theme }) => ({
    position: 'absolute',
    top: theme.spacing(2),
    left: theme.spacing(2),
    width: '150px',
    height: 'auto',
}));

export const AvatarStyled = styled(Avatar)(({ theme }) => ({
    height: theme.spacing(40),
    width: theme.spacing(40),
    marginBottom: theme.spacing(2),
}));

export const CardStyled = styled(Card)(({ theme }) => ({
    padding: theme.spacing(3),
    backgroundColor: '#f9f9f9',
    boxShadow: '0px 3px 15px rgba(0, 0, 0, 0.1)',
    borderRadius: theme.spacing(1),
}));

const LogoutButton = styled(Button)(({ theme }) => ({
    position: 'absolute',
    right: theme.spacing(3),
    top: theme.spacing(2),
}));

const ProfileModal = ({ onLogout }) => {
    const [profileData, setProfileData] = useState(null);
    const [email, setEmail] = useState('');
    const [userId, setUserId] = useState('');
    const [name, setName] = useState('');
    const [role, setRole] = useState('');
    const [birthdate, setBirthdate] = useState('');
    const [height, setHeight] = useState('');
    const [weight, setWeight] = useState('');
    const [interests, setInterests] = useState('');
    const [bio, setBio] = useState('');
    const [avatarURL, setAvatarURL] = useState('');
    const [error, setError] = useState('');
    const [isEditing, setIsEditing] = useState(false);
    const [loading, setLoading] = useState(true);
    const [anchorEl, setAnchorEl] = useState(null);
    const [success, setSuccess] = useState(null);
    const [uploading, setUploading] = useState(false);

    const navigate = useNavigate();

    // Handle Logout
    const handleLogOut = async () => {
        setError(null);
        setSuccess(null);

        try {
            await Axios.get("http://localhost:8080/logout");
            if (onLogout) {
                onLogout();
            }

            setSuccess('Log out successful!');
            navigate('/App');
        } catch (error) {
            setError('Log out failed: ' + error.message);
        }
    };

    useEffect(() => {
        const fetchProfileData = async () => {
            try {
                const response = await Axios.post('http://localhost:8080/profileData', {}, { withCredentials: true });
                setProfileData(response.data);
                setEmail(response.data.email);
                setName(response.data.name);
                setRole(response.data.role);
                setBirthdate(response.data.birthdate);
                setHeight(response.data.height);
                setWeight(response.data.weight);
                setInterests(response.data.interests);
                setBio(response.data.bio);
                setAvatarURL(response.data.avatarURL);
            } catch (error) {
                setError('Error fetching profile data. Please try again.');
            } finally {
                setLoading(false);
            }
        };

        fetchProfileData();
    }, []);

    const handleEditToggle = () => {
        setIsEditing(!isEditing);
    };

    if (loading) {
        return <CircularProgress />;
    }

    return (
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <AppContainer>
                <Logo src={logo} alt="logo" onClick={() => navigate('/Dashboard')} />

                <Grid container spacing={4} alignItems="center" justifyContent="center">
                    {/* Avatar Section */}
                    <Grid item xs={12} sm={5} style={{ textAlign: 'center' }}>
                        <Typography variant="h4" gutterBottom>{name}</Typography>
                        <AvatarStyled src={avatarURL || '/default-avatar.png'} />
                        <input
                            accept="image/*"
                            style={{ display: 'none' }}
                            id="avatar-upload"
                            type="file"
                        />
                        <label htmlFor="avatar-upload">
                            <Button variant="contained" color="primary" style={{ marginTop: '1rem' }}>
                                Change Photo
                            </Button>
                        </label>
                        {uploading && <CircularProgress />}
                    </Grid>

                    {/* Profile Information Section */}
                    <Grid item xs={12} sm={7}>
                        <CardStyled>
                            {isEditing ? (
                                <>
                                    <TextField fullWidth label="Edit Name" value={name} onChange={(e) => setName(e.target.value)} />
                                    <TextField fullWidth label="Edit Birthdate" value={birthdate} onChange={(e) => setBirthdate(e.target.value)} />
                                    <TextField fullWidth label="Edit Height (cm)" value={height} onChange={(e) => setHeight(e.target.value)} />
                                    <TextField fullWidth label="Edit Weight (Kg)" value={weight} onChange={(e) => setWeight(e.target.value)} />
                                    <TextField fullWidth label="Edit Interests" value={interests} onChange={(e) => setInterests(e.target.value)} />
                                    <TextField fullWidth label="Edit Bio" value={bio} onChange={(e) => setBio(e.target.value)} />
                                    <Button variant="contained" color="primary" onClick={() => { setIsEditing(false); }}>Save Profile</Button>
                                </>
                            ) : (
                                <CardContent>
                                    <Grid container spacing={2}>
                                        <Grid item xs={12} sm={6}>
                                            <Typography variant="body1">
                                                <AccountCircleIcon /> <strong>User Id:</strong> {userId}
                                            </Typography>
                                            <Typography variant="body1">
                                                <EmailIcon /> <strong>Email:</strong> {email}
                                            </Typography>
                                            <Typography variant="body1">
                                                <CakeIcon /> <strong>Birthdate:</strong> {birthdate}
                                            </Typography>
                                            <Typography variant="body1">
                                                <FitnessCenterIcon /> <strong>Weight (kg):</strong> {weight}
                                            </Typography>
                                            <Typography variant="body1">
                                                <InfoIcon /> <strong>Bio:</strong> {bio}
                                            </Typography>
                                        </Grid>
                                        <Grid item xs={12} sm={6}>
                                            <Typography variant="body1">
                                                <AccountCircleIcon /> <strong>Name:</strong> {name}
                                            </Typography>
                                            <Typography variant="body1">
                                                <WorkIcon /> <strong>Role:</strong> {role}
                                            </Typography>
                                            <Typography variant="body1">
                                                <HeightIcon /> <strong>Height (cm):</strong> {height}
                                            </Typography>
                                            <Typography variant="body1">
                                                <FavoriteIcon /> <strong>Interests:</strong> {interests}
                                            </Typography>
                                        </Grid>
                                    </Grid>
                                    <Button variant="contained" color="primary" startIcon={<EditIcon />} onClick={handleEditToggle}>
                                        Edit Profile
                                    </Button>
                                </CardContent>
                            )}
                        </CardStyled>
                    </Grid>
                </Grid>

                <LogoutButton variant="contained" color="secondary" onClick={handleLogOut}>
                    Logout
                </LogoutButton>
            </AppContainer>
        </ThemeProvider>
    );
};

export default ProfileModal;
